// 리액트 라이브러리에서 컴포넌트 클래스를 로딩하는 것
import React, {Component} from 'react';

class TOC extends Component {
    render() {
    var lists = [];
    var data = this.props.data;
    var i = 0;
    while(i< data.length){
        lists.push(<li key={data[i].id}><a href={"/content/"}>{data[i].title}</a></li>);
        i = i+1;
    }
    return (
      <nav>
        <ul>
          {/* <li><a href="1.html">HTML</a></li>
          <li><a href="2.html">CSS</a></li>
          <li><a href="3.html">JavaScript</a></li> */}
          {lists}
        </ul>
      </nav>
    );
}
}


// 어떤 것을 외부에서 사용할 수 있게 허용하는 것;
export default TOC;
